The ownership and access system in Rust is quite restrictive and also non-intuitive at first for developers with C++/Java/C# background. As we will see, the reason is to guarantee safety, at compile time. Here are the basic rules for ownership: Values in Rust have exactly one owner at a time, meaning there is one and only one responsible for deallocating the value when it's not needed anymore. No memory leaks or double frees anymore. Owner can change over time by moving the value, but at any given time there is only one owner. The old owner is said to be consumed in this case. Move does not touch the value (neither the contents nor the memory location), no non-trivial move constructors (Ã  la C++) are allowed. Owner always has a valid value as well No unitialized data Deallocation is similar to RAII in C++: the value is dropped when the last owner goes out of scope All the potential code locations for deallocation (typically there is only one location) can be determined at compile-time, so no need for garbage collection (unlike Java and C#) It explains the problem with the double call, assert_eq!(point.is_close_to_origin(), false); assert_eq!(point.is_close_to_origin(), false); since point is consumed at the first call of is_close_to_origin(). But why then x is not consumed in the second example above? let x = 5; let y = x; i32, as well as many other stack-allocated types, can be efficiently copied by directly copying the bits These types have Copy trait, which we cover in more detail in the next Section Rust always copies types with Copy instead of moving them (on every assignment and passing to function) No accidental implicit copies for non-Copy types are possible (in contrast with C++) MyPoint has only stack-allocated values inside, can't we make it Copy as well? Yes, we can: #[derive(Copy,Clone)]
