We don't actually need an independent copy of MyPoint on every method call. (We get now in total 3 different copies of the same value!) What we really need is only to read the value, how to do that? Borrowing is the way to go. Borrow rules: You can access a value without owning it. You are then borrowing it, which basically means you have a reference (or a pointer, if we dig at lower level) to the value You either: only read the value contents ( immutable borrow ), the syntax is &T OR both read and write ( mutable borrow ), the syntax is &mut T You can have multiple immutable borrows OR a single mutable borrow (not both at the same time) Immutable borrow means not only that you can't change the value, but nobody else can do that either! Compiler makes sure that references are always valid: No dangling pointers References are never null pointers So what we need for the previous example is an immutable borrow: struct MyPoint { x: f64, y: f64,
}
impl MyPoint {
# fn new(x: f64, y: f64) -> Self {
# Self{x: x, y: y}
# } fn is_close_to_origin(&self) -> bool { (self.x * self.x + self.y * self.y) < f64::EPSILON }
} fn main() { let point = MyPoint::new(3., 4.); assert_eq!(point.is_close_to_origin(), false); assert_eq!(point.is_close_to_origin(), false);
} Note that we've removed #[derive(...)] as we don't need to copy the values anymore When do we need a mutable borrow? First trial: # struct MyPoint {
# x: f64,
# y: f64,
# }
# impl MyPoint {
# fn new(x: f64, y: f64) -> Self {
# Self{x: x, y: y}
# }
# } fn scalePoint(point: &mut MyPoint, factor: f64) { point.x *= factor; point.y *= factor;
} fn main() { let mut point = MyPoint::new(3., 4.); let borrow1 = &mut point; let borrow2 = &mut point; scalePoint(borrow1, 10.); println!("Coordinates are: {}, {}", point.x, point.y); scalePoint(borrow2, 10.); println!("Coordinates are: {}, {}", point.x, point.y);
} Code can be fixed by swapping two lines. Which ones? NOTE: references have scope rules other than normal variables: the reference scope ends once the reference is used last (not at the end of the { ... } block). It's called Non-Lexical Lifetimes (NLL) . Second trial (refactoring function into a method): # struct MyPoint {
# x: f64,
# y: f64,
# }
impl MyPoint {
# fn new(x: f64, y: f64) -> Self {
# Self{x: x, y: y}
# } fn scale(&mut self, factor: f64) { self.x *= factor; self.y *= factor; }
} fn main() { let mut point = MyPoint::new(3., 4.); point.scale(10.); println!("Coordinates are: {}, {}", point.x, point.y); point.scale(10.); println!("Coordinates are: {}, {}", point.x, point.y);
} We have two mutable borrows, but we don't violate any rules, since these two have different scopes. To get the value back from a reference, use the dereferencing syntax *: fn main() { let mut value = 5; let reference = &mut value; *reference += 1;
