Traits: Are the Rust approach to interfaces (contracts between different parts of the code) Traits only declare methods (not data members) Are powered by generics, though generics do not necessarily involve traits Allow to write polymorphic code Are good for dependency injection and mocking while testing For example, you may emulate a hardware peripheral: trait SerialPort { fn read_byte(&self) -> u8;
} struct SerialPortMock; impl SerialPort for SerialPortMock { fn read_byte(&self) -> u8 { 0 }
