} Single type can have (and usually does have) multiple traits, traits are easily composed Compare this approach with the idiomatic hierarchy-based solution in pre-C++20 (multiple inheritance) which leads to the infamous diamond problem . See more about the Rust and why it does not have the diamond problem here . Inheritance in OOP languages involves runtime polymorphism while traits provide compile-time polymorphism

