core::marker::Copy is a trait used to implicitly copy values bit-by-bit, instead of moving the value pub trait Copy: Clone { } Copy is an example of a marker trait: it does not introduce any new methods or types, it only indicates whether a certain operation is possible with the type. Syntax with : means a trait bound : any type implementing Copy should implement Clone as well. core::clone::Clone is a trait that allows cloning the values: pub trait Clone { fn clone(&self) -> Self; fn clone_from(&mut self, source: &Self) { ... }
} Differences between cloning and copying: If you want to clone, you always should do this explicitly, a = b.clone(); No implicit cloning! (In this particular case, we get two values and two owners, a and b, similar to copying.) Cloning can be equivalent to copying, but can be totally different. On contrary, copying cannot be overriden. Good thing: you only need to implement clone() (it is called a "required method"). Once that is done, the other method (clone_from()) is provided automatically for you ("provided method"). Both Copy and Clone can be automatically derived (with some default implementation), we saw that in Section on Ownership #[derive(Copy,Clone)]
struct MyPoint { x: f64, y: f64 } Some values can be neither copied nor cloned (only moved): for example for a unique resource like an open file or a hardware peripheral

