How to implement a function that either returns either some value or no value at all ? In C and in the old-style C++, we use a null pointer for the latter case In Rust, it is idiomatic to use core::option::Option : enum Option<T> { Some(T), None
} Two enum variants store different values: None does not store anything, Some stores a value of T. Option is similar to C++ std::optional , which was introduced only in C++17. For types T that can never be 0 (in binary representation), Rust optimizes None to a null pointer, so no performance loss at all! Option has many batteries included: #[derive(Copy, PartialEq, PartialOrd, Eq, Ord, Debug, Hash)] Plenty of helper functions fn main() { let x: Option<u8> = Some(2); assert_eq!(x.is_some(), true); assert_eq!(x.unwrap(), 2); assert_eq!(x.expect("Oops!"), 2);
} fn main() { let x: Option<u8> = None; x.expect("Oops!");
}

