Whenever an operation may fail , it is idiomatic to use core::result::Result instead of Option enum Result<T, E> { Ok(T), Err(E),
} It has a set of batteries very similar to Option If a function returns a Result and the caller ignores the returned value, the compiler gives a warning It is very popular to use the ? syntactic sugar to propagate errors in an elegant way: fn problematic_function() -> Result<u8, ()> { let x: Result<u8, ()> = Err(()); println!("{:?}", x?); Ok(4)
} fn main() { println!("{:?}", problematic_function());
} Compare this approach with C++/Java/Python exceptions, where error propagation is non-local and you may easily get an exception at runtime that you were not even aware of and which crashes the application! (Or even worse, bloat the code with catching all potential exceptions in a paranoic fashion, just to be on the safe side.)

